import { Component, OnInit, OnDestroy } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { HttpResponse } from '@angular/common/http';
import { NgbActiveModal } from '@ng-bootstrap/ng-bootstrap';
import { AlertService } from 'app/core/util/alert.service';
import { EventManager } from 'app/core/util/event-manager.service';
import { Subject } from '../user/user.model';
import { ResourceService } from './resource.service';
import { ResourceAssignPopupService } from 'app/admin/access-control';

@Component({
  selector: 'ic-resource-assign-functions-dialog',
  templateUrl: './resource-assign-functions-dialog.component.html',
})
export class ResourceAssignFunctionsDialogComponent implements OnInit {
  isSaving?: boolean;
  applicationId?: string;
  resourceId?: string;
  searchedFunctions: Subject[] = [];
  chooseedFunctions: Subject[] = [];

  constructor(
    public activeModal: NgbActiveModal,
    private alertService: AlertService,
    private resourceService: ResourceService,
    private eventManager: EventManager,
    private router: Router
  ) {}

  ngOnInit(): void {
    this.isSaving = false;
  }

  clear(): void {
    this.activeModal.dismiss('cancel');
    this.backToPrevious();
  }

  assign(): void {
    this.isSaving = true;
    if (this.chooseedFunctions.length > 0) {
      this.resourceService.assignFunctions(this.resourceId, this.chooseedFunctions).subscribe(() => {
        this.activeModal.dismiss('cancel');
        this.eventManager.broadcast({ name: 'assignedFunctionListModification', content: 'OK' });
        this.backToPrevious();
      });
    }
  }

  backToPrevious(): void {
    setTimeout(() => {
      this.router.navigate(['admin/acm/ic-resource/' + this.resourceId?.toString()]);
    }, 0);
  }

  searchUnAssignFunctions(event: any): void {
    this.resourceService
      .searchUnAssignedFunctions({
        applicationId: this.applicationId,
        resourceId: this.resourceId,
        resourceName: event.query,
        page: 0,
        size: 1000,
        sort: null,
      })
      .subscribe(
        (res: HttpResponse<any>) => {
          this.searchedFunctions = res.body;
        },
        (res: HttpResponse<any>) => this.onError(res.body)
      );
  }

  private onError(error: any): void {
    this.alertService.addAlert({ type: 'danger', translationKey: error.message });
  }
}

@Component({
  selector: 'ic-resource-assign-resources-popup',
  template: '',
})
export class ResourceAssignFunctionsPopupComponent implements OnInit, OnDestroy {
  routeSub: any;

  constructor(private route: ActivatedRoute, private resourceAssignPopupService: ResourceAssignPopupService) {}

  ngOnInit(): void {
    this.routeSub = this.route.params.subscribe(params => {
      if (params['applicationId'] && params['resourceId']) {
        this.resourceAssignPopupService.open(
          ResourceAssignFunctionsDialogComponent as Component,
          params['applicationId'],
          params['resourceId']
        );
      }
    });
  }

  ngOnDestroy(): void {
    this.routeSub.unsubscribe();
  }
}
<div class="modal-header">
  <h4 class="modal-title" id="myGroupLabel">Assign Functions to Resource</h4>
  <button type="button" class="close" data-dismiss="modal" aria-hidden="true" (click)="clear()">&times;</button>
</div>

<div class="modal-body">
  <div class="rounded-pill row">
    <label class="col-sm-3 form-control-label">Search By Function Name</label>
    <div class="col-sm-9">
      <p-autoComplete
        class="ui-fluid"
        [(ngModel)]="chooseedFunctions"
        name="chooseedFunctions"
        [suggestions]="searchedFunctions"
        (completeMethod)="searchUnAssignFunctions($event)"
        field="resourceName"
        [multiple]="true"
      ></p-autoComplete>
    </div>
  </div>
</div>

<div class="modal-footer">
  <button
    type="button"
    [disabled]="isSaving || !chooseedFunctions || chooseedFunctions.length === 0"
    class="btn btn-primary btn-sm"
    (click)="assign()"
  >
    <fa-icon [icon]="'save'"></fa-icon>&nbsp;<span>Assign Functions</span>
  </button>
  <button type="button" class="btn btn-secondary btn-sm" data-dismiss="modal" (click)="clear()">
    <fa-icon [icon]="'ban'"></fa-icon>&nbsp;<span icTranslate="entity.action.cancel">Cancel</span>
  </button>
</div>
